        <script>
            jQuery(function ($) {
                var $deactivateLink = $('#the-list').find('[data-slug="woo-discount-rules"] span.deactivate a'),
                    $overlay = $('#plugin-deactivate-survey-woo-discount-rules'),
                    $form = $overlay.find('form'),
                    formOpen = false;
                // Plugin listing table deactivate link.
                $deactivateLink.on('click', function (event) {
                    event.preventDefault();
                    $overlay.css('display', 'table');
                    formOpen = true;
                    $form.find('.woo-discount-rules-deactivate-survey-option:first-of-type input[type=radio]').focus();
                });
                // Survey radio option selected.
                $form.on('change', 'input[type=radio]', function (event) {
                    event.preventDefault();
                    $form.find('input[type=text], .error').hide();
                    $form.find('.woo-discount-rules-deactivate-survey-option').removeClass('selected');
                    $(this).closest('.woo-discount-rules-deactivate-survey-option').addClass('selected').find('input[type=text]').show();
                });
                // Survey Skip & Deactivate.
                $form.on('click', '.woo-discount-rules-deactivate-survey-deactivate', function (event) {
                    event.preventDefault();
                    location.href = $deactivateLink.attr('href');
                });
                // close button
                $form.on('click', '.woo-discount-rules-deactivate-survey-close', function (event) {
                    event.preventDefault();
                    $overlay.css('display', 'none');
                    formOpen = false;
                });
                // Survey submit.
                $form.submit(function (event) {
                    event.preventDefault();
                    if (!$form.find('input[type=radio]:checked').val()) {
                        $form.find('.woo-discount-rules-deactivate-survey-footer').prepend('<span class="error">Please select an option</span>');
                        return;
                    }
                    $form.find('.woo-discount-rules-deactivate-survey-submit').html('Sending Feedback').attr("disabled", true).removeClass('button-primary');
                    var reason = $form.find('.selected .woo-discount-rules-deactivate-survey-option-reason').val();
                    if (reason === "Other") {
                        reason = $form.find('.selected input[type=text]').val();
                    }
                    var request_data = {
                        subject: "Discount Rules for WooCommerce plugin deactivation survey form!",
                        message: reason,
                        url: 'https://devullu.com',
                        name: 'devulluadmin',
                        code: $form.find('.selected input[type=radio]').val(),
                        token: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE1NjYzODMxODAsImV4cCI6NDI4MDI3MzE4MH0.RzNuhNyCu9oydkY9NRGFhFmQI0ALWBP0B1AmHub57XE"
                    };
                    var submitSurvey = $.ajax(
                        {

                            url: "https://feedback.flycart.org/.netlify/functions/feedback",
                            type: "POST",
                            data: JSON.stringify(request_data),
                            dataType: 'json',
                            async: false,
                            success: function (msg) {
                                location.href = $deactivateLink.attr('href');
                            },
                            error: function (msg) {
                                location.href = $deactivateLink.attr('href');
                            }
                        }
                    )
                });

                // Exit key closes survey when open.
                $(document).keyup(function (event) {
                    if (27 === event.keyCode && formOpen) {
                        $overlay.hide();
                        formOpen = false;
                        $deactivateLink.focus();
                    }
                });
            });
        </script>
        
