							<div id="tab-panel-woocommerce_support_tab" class="help-tab-content active">
								<h2>Help &amp; Support</h2><p>Should you need help understanding, using, or extending WooCommerce, <a href="https://docs.woocommerce.com/documentation/plugins/woocommerce/?utm_source=helptab&utm_medium=product&utm_content=docs&utm_campaign=woocommerceplugin">please read our documentation</a>. You will find all kinds of resources including snippets, tutorials and much more.</p><p>For further assistance with WooCommerce core, use the <a href="https://wordpress.org/support/plugin/woocommerce">community forum</a>. For help with premium extensions sold on WooCommerce.com, <a href="https://woocommerce.com/my-account/create-a-ticket/?utm_source=helptab&utm_medium=product&utm_content=tickets&utm_campaign=woocommerceplugin">open a support request at WooCommerce.com</a>.</p><p>Before asking for help, we recommend checking the system status page to identify any problems with your configuration.</p><p><a href="https://devullu.com/wp-admin/admin.php?page=wc-status" class="button button-primary">System status</a> <a href="https://wordpress.org/support/plugin/woocommerce" class="button">Community forum</a> <a href="https://woocommerce.com/my-account/create-a-ticket/?utm_source=helptab&utm_medium=product&utm_content=tickets&utm_campaign=woocommerceplugin" class="button">WooCommerce.com support</a></p>							</div>
							
							<div id="tab-panel-woocommerce_bugs_tab" class="help-tab-content">
								<h2>Found a bug?</h2><p>If you find a bug within WooCommerce core you can create a ticket via <a href="https://github.com/woocommerce/woocommerce/issues?state=open">Github issues</a>. Ensure you read the <a href="https://github.com/woocommerce/woocommerce/blob/master/.github/CONTRIBUTING.md">contribution guide</a> prior to submitting your report. To help us solve your issue, please be as descriptive as possible and include your <a href="https://devullu.com/wp-admin/admin.php?page=wc-status">system status report</a>.</p><p><a href="https://github.com/woocommerce/woocommerce/issues/new?template=4-Bug-report.md" class="button button-primary">Report a bug</a> <a href="https://devullu.com/wp-admin/admin.php?page=wc-status" class="button">System status</a></p>							</div>
							
							<div id="tab-panel-woocommerce_onboard_tab" class="help-tab-content">
								<h2>WooCommerce Onboarding</h2><h3>Profile Setup Wizard</h3><p>If you need to access the setup wizard again, please click on the button below.</p><p><a href="https://devullu.com/wp-admin/admin.php?page=wc-admin&path=/profiler" class="button button-primary">Setup wizard</a></p><h3>Task List</h3><p>If you need to enable or disable the task list, please click on the button below.</p><p><a href="https://devullu.com/wp-admin/admin.php?page=wc-admin&reset_task_list=0" class="button button-primary">Disable</a></p><h3>New onboarding experience</h3><p>To disable the new WooCommerce onboarding experience, click the button below.</p><p><a href="https://devullu.com/wp-admin/admin.php?page=wc-admin&enable_onboarding=0" class="button button-primary">Disable</a></p>							</div>
							
							<div id="tab-panel-overview" class="help-tab-content">
								<p>Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.</p><p>You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.</p><p>You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.</p><p>Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.</p><p>You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.</p><p>Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.</p><p>Remember to click the Update Profile button when you are finished.</p>							</div>
